import React from 'react';
import Zoom from 'react-reveal/Zoom';
import './css/Info.css';

function Info() {

    return (
        <section className="info-block" id="#info">
            <Zoom>
                <p>辩处事之道，论经世之心；探人间至理，证生活本真<br/>
                    口角锋芒，尽显大家风采；舌灿莲花，不负才俊风流<br/>
                    己亥年盛夏，看绝艳惊才，汇聚狮城<br/>
                    第十届亚太大专华语辩论赛，静候君来。
                </p>
            </Zoom>

        </section>
    );
}

export default Info;
